import React from "react";

const TodoSearch = () => {

    return (
        <Row>
            <Col>
                <Form>
                    <Form.Check
                        type="checkbox" 
                        checked={completed} 
                        onChange={toggleCompletion}
                        />
                </Form>
            </Col>
            <Col>
                <Button variant="link" onClick={onDelete}>
                    <i className="fa fa-remove text-danger" />
                </Button>
            </Col>
        </Row>
    );

}

export default TodoSearch
